import CommentBox from "./CommentBox.js";
import RecommendButton from "./RecommendButton.js";

export function loadcommentsJsonToList(comments) {
  if (comments) {
    var comment_list = [];
    for (var key in commentsJson) {
      comment_list.push(
        <div>
          <CommentBox isReadOnly={true} content={commentsJson[key].contents}></CommentBox>
          <RecommendButton fixed={false} value={commentsJson[key].recommend}></RecommendButton>
        </div>
      );
    }
    return comment_list;
  }
}
